import React, { Component } from 'react';
import Web3 from 'web3';
import SaveChildren from '../abis/SaveChildren.json'
import '../components/App.css';
import { Line } from 'react-chartjs-2';


class UserDashBoard extends Component{

    constructor(props){
        super(props)
        this.state = {
            contract: null,
            account: '',
            campaigns: [],
            labels: [],
            data: []
        }
    }

    async componentWillMount() {
        await this.loadWeb3()

        await this.loadBlockchainData()
        await this.printUserCampaigns()
    }


    async loadWeb3() {
        if (window.ethereum) {
            window.web3 = new Web3(window.ethereum)
            await window.ethereum.enable()
        }
        else if (window.web3) {
            window.web3 = new Web3(window.web3.currentProvider)
        }
        else {
            window.alert('Non-Ethereum browser detected. You should consider trying MetaMask!')
        }
    }


    async loadBlockchainData() {
        const web3 = window.web3
        // Load account
        const accounts = await web3.eth.getAccounts()
        this.setState({account: accounts[0]})

        const networkId = await web3.eth.net.getId()
        const networkData = SaveChildren.networks[networkId]
        if(networkData) {
            
            const abi = SaveChildren.abi
            const address = networkData.address
            const contract = new web3.eth.Contract(abi, address)
            this.setState({ contract: contract})

            const campaigns = await contract.methods.getCampaigns().call()
            this.setState({ campaigns: [...this.state.campaigns, campaigns]})

        } else {
            window.alert('Smart contract not deployed to detected network')
        }
    }

    async printUserCampaigns(){
        const totalSupply = await this.state.contract.methods.getCampaignsLength().call()

        for(var i =0;i<totalSupply;i++){

            const campaign = await this.state.contract.methods.campaigns(i).call()

            if(campaign.owner == this.state.account){
                this.setState({
                    labels: [...this.state.labels, campaign.name],
                    data: [...this.state.data, campaign.raised/(10**18)]
                })
                console.log(Boolean(campaign.isFinished))
                if(Boolean(campaign.isFinished) == false){
                    const main = document.getElementById("activeCampaigns")
                    const paragraf = document.createElement('p')
                    paragraf.innerHTML = campaign.name

                    main.appendChild(paragraf)
                }
                else{
                    const main = document.getElementById("inactiveCampaigns")
                    const paragraf = document.createElement('p')
                    paragraf.innerHTML = campaign.name

                    main.appendChild(paragraf)
                }
            }
        }
    }


    render() {
        return (
            <div>
                <div>
                <Line
                    data = {{
                        labels: this.state.labels,
                        datasets: [
                            {
                                label: 'Amount that campaigns have raised',
                                data: this.state.data,
                                borderColor: 'Gren',
                                tension: 0.1, /* Koliko je ostra linija promeniti po potrebi */
                            }
                        ]
                    }}
                    height = {400}
                    width = {600}
                    options = {{
                        maintainAspectRatio: false,
                        scales: {
                            yAxes: [{
                                ticks: {
                                    beginAtZero: true
                                }

                            }]
                        }
                    }}
                />
                </div>
                <div id = "activeCampaigns">
                    <h2>Active</h2>
                </div>
                <div id = "inactiveCampaigns">
                    <h2>Inactive</h2>
                </div>
            </div>
        );
    }



}

export default UserDashBoard;
